import { BrowserRouter, Switch, Route } from "react-router-dom";
import Orders from "./Orders";
import Home from "./Home";

function Routes() {
    return(
        <BrowserRouter>
            Nav
            <Switch>
                <Route path ="/orders">
                    <Orders />
                </Route>
                <Route path ="/">
                    <Home />
                </Route>
            </Switch>
        </BrowserRouter>
    )
}
export default Routes;
